import './App.css';
import Header from './components/Header';
import TasksList from './components/TasksList';


function App() {
  const initialTasks = [
    { id: 1, text: "Learn React" },
    { id: 2, text: "Do homework" },
    { id: 3, text: "Cook dinner" },
  ];

  return (
    <div className="App">
      <Header />
      <ul>
        <TasksList tasks={initialTasks} />
      </ul>
    </div>
  );
}

export default App;
